// Veritabanindaki tum filmleri veya title yada actor'e gore arama yapilan filmleri cek
async function getProducts() {
  let url = 'http://localhost:8080/product/getall';

  try {
    let res = await fetch(url);
    return await res.json();
  } catch (error) {
    console.log(error);
  }
}
